import pandas as pd
from collections import Counter

'''

# Author: Heeryon Cho <heeryon.cho@gmail.com>
# License: BSD-3-clause

This code analyzes the statistics of the gathered k-pop & j-pop lyrics data,
and merges lyrics text with other song information including:
 
1. Year
2, Ranking 
3. SongName
4. ArtistName, 
5. URL
6. Lyrics

The verbose files are saved as: 
--- 'lyrics_jp/jp_lyrics_verbose.csv'
--- 'lyrics_kr/kr_lyrics_verbose.csv'

'''

def integrate_info():
    print("\nTHIS CODE OUTPUTS THE STATISTICS OF THE CRAWLED K-POP & J-POP LYRICS DATA.")

    # =========================================================================

    print("\n*******************")
    print("       K-POP       ")
    print("*******************")

    print("\n====== Melon ======")
    df_url_kr = pd.read_csv("ranking/kr_ranking_url.csv")
    print(df_url_kr.shape, "# shape")
    df_url_kr = df_url_kr.dropna()
    print(df_url_kr.shape, "# dropna()")
    df_url_kr = df_url_kr.drop_duplicates()
    print(df_url_kr.shape, "# drop_duplicates()")
    print(list(df_url_kr))

    print("\n====== K-POP LYRICS ======")
    df_lyrics_kr = pd.read_csv("lyrics_kr/kr_lyrics.csv")
    print(df_lyrics_kr.shape, "# shape")
    df_lyrics_kr = df_lyrics_kr.dropna()
    print(df_lyrics_kr.shape, "# dropna()")
    df_lyrics_kr = df_lyrics_kr.drop_duplicates()
    print(df_lyrics_kr.shape, "# drop_duplicates()")
    print(list(df_lyrics_kr))

    url_set_kr = set(df_lyrics_kr['URL'].values)
    print(len(url_set_kr), "# uniq URL")

    print("\n====== JOIN ======")
    df_kr = pd.merge(df_lyrics_kr, df_url_kr, on='URL', how='inner')
    print(df_kr.shape, "# shape")
    df_kr = df_kr.dropna()
    print(df_kr.shape, "# dropna()")
    df_kr = df_kr.drop_duplicates()
    print(df_kr.shape, "# drop_duplicates()")
    print(list(df_kr))

    print("\n====== COUNT ======")
    df_final_kr = df_kr.sort_values(['Year', 'Ranking'], ascending=[True, True])
    new_order = ['Year', 'Ranking', 'SongName', 'ArtistName', 'URL', 'Lyrics']
    df_final_kr = df_final_kr[new_order]

    counts = Counter(list(df_final_kr['URL'].values))
    print(counts)

    df_final_kr.to_csv("lyrics_kr/kr_lyrics_verbose.csv", index=False)

    # =========================================================================

    print("\n*******************")
    print("       J-POP       ")
    print("*******************")

    print("\n====== Utanet ======")
    df_url_jp_utanet = pd.read_csv("ranking/jp_ranking_url_utanet.csv")
    print(df_url_jp_utanet.shape, "# shape")
    df_url_jp_utanet = df_url_jp_utanet.dropna()
    print(df_url_jp_utanet.shape, "# dropna()")
    df_url_jp_utanet = df_url_jp_utanet.drop_duplicates()
    print(df_url_jp_utanet.shape, "# drop_duplicates()")
    print(list(df_url_jp_utanet))

    print("\n====== J-lyrics ======")
    df_url_jp_jlyric = pd.read_csv("ranking/jp_ranking_url_jlyrics.csv")
    print(df_url_jp_jlyric.shape, "# shape")
    df_url_jp_jlyric = df_url_jp_jlyric.dropna()
    print(df_url_jp_jlyric.shape, "# dropna()")
    df_url_jp_jlyric = df_url_jp_jlyric.drop_duplicates()
    print(df_url_jp_jlyric.shape, "# drop_duplicates()")
    print(list(df_url_jp_jlyric))

    print("\n====== Utanet + J-lyrics ======")
    df_both = pd.concat([df_url_jp_utanet, df_url_jp_jlyric], axis=0)
    print(df_both.shape, "# shape")
    print(list(df_both), "list()")

    url_both = set(df_both['URL'].values)
    print(len(url_both), "# uniq URL")

    print("\n====== J-POP LYRICS MERGED ======")
    df_lyrics_jp = pd.read_csv("lyrics_jp/jp_lyrics.csv")
    print(df_lyrics_jp.shape, "shape")
    df_lyrics_jp = df_lyrics_jp.dropna()
    print(df_lyrics_jp.shape, "# dropna()")
    df_lyrics_jp = df_lyrics_jp.drop_duplicates()
    print(df_lyrics_jp.shape, "# drop_duplicates()")
    print(list(df_lyrics_jp))

    url_set_jp = set(df_lyrics_jp['URL'].values)
    print(len(url_set_jp), "# uniq URL")

    print("\n====== JOIN ======")
    df_jp = pd.merge(df_lyrics_jp, df_both, on='URL', how='inner')
    print(df_jp.shape, "# shape")
    df_jp = df_jp.dropna()
    print(df_jp.shape, "# dropna()")
    df_jp = df_jp.drop_duplicates()
    print(df_jp.shape, "# drop_duplicates()")
    print(list(df_jp))

    print("\n====== COUNT ======")
    df_final_jp = df_jp.sort_values(['Year', 'Ranking'], ascending=[True, True])
    new_order = ['Year', 'Ranking', 'SongName', 'ArtistName', 'URL', 'Lyrics']
    df_final_jp = df_final_jp[new_order]

    counts = Counter(list(df_final_jp['URL'].values))
    print(counts)

    df_final_jp.to_csv("lyrics_jp/jp_lyrics_verbose.csv", index=False)






